function isPalindrome(str) {
    let letterArr = str.split('');
    let bottomIndex = 0; 
    let topIndex = letterArr.length-1;
    while(bottomIndex < topIndex){
        if(letterArr[bottomIndex] !== letterArr[topIndex]){
            return false;
        }
        bottomIndex++;
        topIndex--;
    }
    // Good luck!
    return true;
}
